import Banner from '../components/Banner';
import Booking from '../components/Booking';

const Home = () => {
	return (
		<>
			<Banner />
			<Booking />
			<div>
				<h3>What guests are saying about homes in the United States</h3>
			</div>
		</>
	);
};

export default Home;
